import {View} from 'react-native';
import style from './OpenPhotoView.Styles';
import PhotoAlbum4SVG from '../svgFiles/photoAlbum4Large.svg';

export default function PhotoAlbum4() {
    return (
        <View>
            <PhotoAlbum4SVG/>
        </View>
    )
}
